	"description": "<p>The following is borrowed directly from the Thought Lounge non-profit group (<a href=\"http:\/\/thoughtlounge.org\/\" class=\"linkified\">http:\/\/thoughtlounge.org\/<\/a>):<\/p> <p>A Thought Lounge Session is a lightly structured dialogue in which 3-6 participants (yourself included!) are organized by a Host to meet in person. At the beginning of a TL Session there is an \u201copening one-breath ritual,\u201d in which all participants state how they are feeling and why they came. The Host then goes over the TL 5 Agreements of Dialogue, and each person is invited to lead a 12 minute conversation on a topic that strikes passion in them. After all 3-6 topics have been presented, the Host writes the topics on a whiteboard and participants take an additional 12 minutes to talk about and draw connections between them. At the end of the TL Session there is another \u201cclosing one-breath ritual,\u201d in which participants state how they are feeling after the session, and how they felt it went.<\/p> <p>BRING A TOPIC FOR CONVERSATION that is at the frontier of your mind and close to your heart right now. There are no restrictions on topics. Literally thousands of topics have been brought in the past, from \"is there such thing as romantic love, or is it a compilation of other loves\" to \"the foundations of mathematics\" to \"surfboard shaping\" to \"what is your funniest life moment.\" See <a href=\"http:\/\/thoughtlounge.org\/pasttopics\" class=\"linkified\">http:\/\/thoughtlounge.org\/pasttopics<\/a> for more examples.<\/p> <p>TL Sessions will begin promptly at 5:30, and end at 7:00pm. You MUST be able to stay for the entire duration of the TL Session, or we ask that you wait to sign up until next time.<\/p> <p>=======================================================================<br\/>Notes:<br\/>1. Please update your attendance if your plans change as spots are limited!<\/p> <p>2. Please BYOB and chairs, or feel free to chill on the floor.<\/p> <p>3. We will most likely be grabbing food afterwards in downtown Sunnyvale!<\/p> ",
