	"description": "<p>\u2022 What we'll do<br\/>Do you enjoy hiking? Do scavenger hunts interest you? If yes, consider orienteering your sport! The Bay Area Orienteering Club (BAOC) is hosting its a C-Meet at Joaquin Miller Park as a part of its Summer Series.<\/p> <p>Enter Joaquin Miller Park and you will quickly forget that you are minutes away from the hustle and bustle of the city. Hikers, equestrians, bicyclists, joggers and picnickers from all over the Bay Area regularly frequent the 500-acre park. The rustic woodland trails lead you through redwood groves and oak woodlands and across lush creeksides and wet meadows.<\/p> <p>Where: We will meet at the Redwood Glen trailhead, which is walking distance from parking.(<a href=\"https:\/\/goo.gl\/maps\/o4J2bZEgDu52\" class=\"linkified\">https:\/\/goo.gl\/maps\/o4J2bZEgDu52<\/a>)<\/p> <p>Sign up to give \/ join a carpool at: <a href=\"https:\/\/www.groupcarpool.com\/t\/f4pb2n\" class=\"linkified\">https:\/\/www.groupcarpool.com\/t\/f4pb2n<\/a> . This is highly recommended for a few reasons: parking will be limited, some of my non meetup friends are carpooling, and we should spare the air! You get picked up from a BART station!<\/p> <p>Joaquin Miller Park Webpage (<a href=\"http:\/\/www2.oaklandnet.com\/government\/o\/opr\/s\/Parks\/JoaquinMiller\/index.htm\" class=\"linkified\">http:\/\/www2.oaklandnet.com\/government\/o\/opr\/s\/Parks\/JoaquinMiller\/index.htm<\/a>) and park map (<a href=\"http:\/\/www2.oaklandnet.com\/oakca1\/groups\/opr\/documents\/agenda\/oak061362.pdf\" class=\"linkified\">http:\/\/www2.oaklandnet.com\/oakca1\/groups\/opr\/documents\/agenda\/oak061362.pdf<\/a>). On that map, our meeting spot is the higher end of the Big Trees trail on Skyline Blvd.<\/p> <p>About the BAOC Summer Series<\/p> <p>We are happy to announce the return of the BAOC Summer Series. This series of moderate-length events will be held from May through August on some of our more-urban and less-steep maps. Thus allowing us to enjoy orienteering during the hotter days of summer.<\/p> <p>From <a href=\"http:\/\/baoc.org\/wiki\/Schedule\/2018\/Summer_Series\" class=\"linkified\">http:\/\/baoc.org\/wiki\/Schedule\/2018\/Summer_Series<\/a><\/p> <p>What is Orienteering?<\/p> <p>In orienteering, you use a map and a compass to locate a series of points shown on a specialized topo map, choosing routes\u2014on or off trail\u2014that will help you find all the points and get to the finish in the shortest amount of time (assuming that you choose to be competitive).<\/p> <p>Each point, or \"control\", is a distinctly mapped feature, such as a stream junction, boulder, or hilltop, and is marked with an orange-and-white flag, or \"bag\".<\/p> <p>From <a href=\"http:\/\/baoc.org\/wiki\/FAQ\" class=\"linkified\">http:\/\/baoc.org\/wiki\/FAQ<\/a><\/p> <p>How to Orienteer?<\/p> <p>Come learn with us at this event!<\/p> <p>Here\u2019s an introductory video (<a href=\"http:\/\/www.howcast.com\/videos\/404244-How-to-Orienteer\" class=\"linkified\">http:\/\/www.howcast.com\/videos\/404244-How-to-Orienteer<\/a>) and the Orienteering USA\u2019s introduction page (<a href=\"http:\/\/orienteeringusa.org\/new-o\/beginners-guide\" class=\"linkified\">http:\/\/orienteeringusa.org\/new-o\/beginners-guide<\/a>).<\/p> <p>\u2022 What to bring<br\/>Bring water, snacks. Hiking clothing and boots are recommended. Orienteering equipment (an E-punch and compass) are optional- they can be rented.<\/p> <p>\u2022 Important to know<br\/>When: Sunday July 8th, 9:30am-12pm<\/p> <p>Cost: Course Fees are $8\/person for beginner courses and $18\/person for advanced courses. In addition, there is a parking fee ($5\/vehicle), a compass rental fee ($1 each), and an E-punch rental ($5 \/team). Jules will provide a compass and a E-punch.<\/p> <p>More info: Learn more about this event and the Bay Area Orienteering Club on their site <a href=\"http:\/\/baoc.org\/wiki\/Schedule\/2018\/Joaquin_Miller\" class=\"linkified\">http:\/\/baoc.org\/wiki\/Schedule\/2018\/Joaquin_Miller<\/a><br\/><a href=\"https:\/\/www.facebook.com\/events\/2057670367838782\" class=\"linkified\">https:\/\/www.facebook.com\/events\/2057670367838782<\/a><\/p> ",
