	"description": "<p>In our first ever Choose Your Own Adventure\/Live RPG type of game, you will be transported back in time to the medieval ages with kings, bandits, and knights (oh my).<\/p> <p>Overview:<br\/>Everyone will start out as normal townsfolk. As the game progresses, you will find loot, complete quests, fight off enemies, and begin to diverge in your life paths. Over time, you will find your role in life as members of different clans... Perhaps you will be the one to lead your clan and unite the whole kingdom!<\/p> <p>Join us for this unique event that was months in the making! Everything will happen very naturally (there are no scripts). This is very much a Choose Your Own Adventure type of game, played out in real-life. What adventure will you choose?<\/p> <p>Come dressed up as medieval characters or other costumes (anything is fair game)! There will be snacks and drinks (non-alcoholic). We'll get dinner afterwards for those who want to stick around.<\/p> <p>This event was created in collaboration with Tyler's Mystery Tours.<\/p> <p>=====<\/p> <p>Cost: $12 per person for supplies and snacks\/drinks<\/p> <p>When you RSVP, be sure to send $12 through Venmo @michelleth or PayPal <a href=\"http:\/\/paypal.me\/michelleth\/12\/\" class=\"linkified\">http:\/\/paypal.me\/michelleth\/12\/<\/a>. We need the payments in advance to hold this event, so we will remove your RSVP if not paid.<\/p> <p>Bring:<br\/>- Come dressed up! Anything is good!<br\/>- Water<\/p> <p>Disclaimer:<br\/>All participants accept sole responsibility for their actions and any consequences that may result. The organizer(s), event host(s), and other members of this group are not liable for any injuries you may sustain, damage you may cause, or criminal charges incurred otherwise while participating in this event. By attending this event, you agree to these terms. You will be required to provide a verbal confirmation accepting this agreement and\/or a signed waiver before being allowed to participate when we meet for this event.<\/p> <p>Are there certain events you want to see? Vote for them or add them here:<br\/><a href=\"http:\/\/tinyurl.com\/OffbeatFunWishlist\" class=\"linkified\">http:\/\/tinyurl.com\/OffbeatFunWishlist<\/a><\/p> ",
