	"description": "<p>Looking to expand your movie repertoire? Join us for an \"offbeat\" movie night!<\/p> <p>Every 3rd Friday (unless changed), we'll gather and watch a movie that's a little bit \"offbeat\"--meaning movies that are either not mainstream or just plain weird.<\/p> <p>If you have ideas for movies to watch, please submit them in the comments!<\/p> <p>=====<\/p> <p>The movie will start at 8pm.<\/p> <p>Come earlier to hang out and join us for a potluck dinner at 7pm. Please bring some food\/drinks to share if you'll be joining for dinner. Write in the comments the type of food\/drinks you'll be bringing so we don't all bring the same things (e.g., entree, appetizer, dessert, wine, beer)!<\/p> <p>Note: Please keep your RSVP updated! Remove yourself (including from the waitlist) if you will no longer attend. We will assign a strike if you remove your RSVP at the last minute (&amp;lt; 48 hours notice) or if you flake (no-show). If there's a waitlist, we'll assign 2 strikes for any flakes. Don't be flaky!<\/p> <p>RSVPs will open up 2 weeks before the event date.<\/p> <p>See our RSVP policy here: <a href=\"https:\/\/www.meetup.com\/Offbeat-Fun\/about\/\" class=\"linkified\">https:\/\/www.meetup.com\/Offbeat-Fun\/about\/<\/a><\/p> <p>--<\/p> <p>Are there certain events you want to see? Vote for them or add them here: <a href=\"http:\/\/tinyurl.com\/OffbeatFunWishlist\" class=\"linkified\">http:\/\/tinyurl.com\/OffbeatFunWishlist<\/a><\/p> ",
