	"description": "<p>Film:<\/p> <p>Showtime:<\/p> <p>Run time:<br\/>__________<\/p> <p>THIS EVENT WILL REPEAT ON THE 4TH SUNDAY OF EVERY MONTH UNLESS STATED OTHERWISE.<\/p> <p>I watch a lot of movies. Sometimes, I think they're worth seeing in theaters. I opt for weekend morning\/matinee showings because they're cheaper and less crowded. Feel free to join me. I will arrive early and hang out in the lobby to the right of the entrance. At 15 minutes prior to the listed showtime, I will enter the theater to take my seat whether or not anyone else shows up.<br\/>__________<\/p> <p>Are there certain events you want to see? Vote for them or add them here: <a href=\"http:\/\/tinyurl.com\/OffbeatFunWishlist\" class=\"linkified\">http:\/\/tinyurl.com\/OffbeatFunWishlist<\/a><\/p> ",
