	"description": "<p>The Perseid Meteor Shower is by far the best show to see year round. It\u2019s always held in comfortable weather unlike it\u2019s brethren. Hopefully we will be graced with a clear night because we will be under a NEW MOON (that means \u2018no moon\u2019); so the viewing will be truly special and spectacular!!! It\u2019s incredibly rare for the peak of the shower to fall under such prime viewing conditions.<\/p> <p>We will be heading to Pinnacles National Park for this one. The park is known for its seclusion from light pollution, all the better for our viewing and to detach from the buzz of day-to-day life.<\/p> <p>Food\/drink: bring your own. I struggled with this... if most of the group is interested in chipping in further than the $5, i can set something up. Just leave your thoughts in the comments. Otherwise, I felt it was better to not constrain people.<\/p> <p>For the adventurers, we will be hiking to the peak in the cloak of darkness to view the show. Make sure to pack lighting if you plan to join in. Departure 10pm-ish.<\/p> <p>Parking will be limited. A carpool sheet and rendezvous points will be set up. Each car will be charged $25 entrance fee. Please chip in for fees and gas to your driver.<\/p> <p>A sheet for tent sharing will be posted. Please list if you can supply a tent or need to share space. There is a limit to the number of tents a campsite is allowed, so please don\u2019t rely on sleeping solo. Star sleepers can do whatever you want \ud83d\ude43.<\/p> <p>For purposes of securing the campsites, I will need to collect a whopping $5 from each person. Venmo your dollars to Vuhuynh101@gmail.com.<\/p> ",
